page_script({init:function(){$(".js-masonry").masonry().masonry("layout"),$('a[data-toggle="tab"].sp_tabs').on("shown.bs.tab",function(a){$($(a.target).attr("href")).masonry()}),$(".map-canvas").each(function(){var a=new google.maps.LatLng($(this).attr("data-latitude"),$(this).attr("data-longitude")),b={scrollwheel:!1,zoom:13,center:a},c=new google.maps.Map($(this)[0],b),d=new google.maps.Marker({position:a});d.setMap(c)})}});